/*
Elabore índices que possam auxiliar no ganho de desempenho de no mínimo 5 consultas complexas (utilize joins, agrupamentos e aninhamentos).
Enviar: Consulta SQL e o índice criado. Dizer se o uso do índice foi vantajoso ou não.
*/

/*1*/
delimiter //
create PROCEDURE sp_show_periodo_prodVendidos(in periodoIni date, in periodoFim date)
BEGIN	
    
    declare somaVendas decimal(15,2);
    
    select sum(iv.total) into somaVendas
    from itens_venda iv
    inner join venda v on iv.idVenda = v.idVenda
	where v.dataVenda between periodoIni and periodoFim;
    
	select p.nome as nomeProduto, sum(iv.total) as somaVendaProduto, (sum(iv.total)*100)/somaVendas as PercentualVendas
	from produto p
    inner join itens_venda iv on p.idProduto = iv.idProduto 
    inner join venda v on iv.idVenda = v.idVenda
	where v.dataVenda between periodoIni and periodoFim
    group by p.idProduto;
   
END;
//delimiter ;

drop PROCEDURE sp_show_periodo_prodVendidos;
    
call sp_show_periodo_prodVendidos("2020-01-01","2020-12-30");

create index indProdutoNome on produto(nome);

alter table produto
drop index indProdutoNome;

/*2*/
create VIEW show_sum_total (Nome, Total)
as
select c.nome, sum(v.total)
from venda v
inner join cliente c on v.idCliente = c.idCliente
where year(v.dataVenda) = 2020
group by v.idCliente
order by 2 desc;

select * from show_sum_total;

create index indClienteNome on cliente(nome);

alter table cliente
drop index indClienteNome;

/*3*/
create VIEW show_venda_produtos (nomeProduto, Marca)
as
select p.nome, m.nome
from itens_venda iv
inner join venda v on iv.idVenda = v.idVenda
inner join produto p on iv.idProduto = p.idProduto
inner join marca m on p.idMarca = m.idMarca
where year(v.dataVenda) = 2020 and MONTH(v.dataVenda) between 7 and 8 and m.nome = "Piracanjuba"
group by p.idProduto
order by 1 desc;

select * from show_venda_produtos;

create index indMarcaNome on marca(nome);

alter table marca
drop index indMarcaNome;

/*4*/
create VIEW show_venda_2020 (dataVenda, NF, subtotal, desconto, total, nomeCliente)
as
select v.dataVenda, v.numeroNF, v.subtotal, v.desconto, v.total, c.nome
from venda v
inner join cliente c on v.idCliente = c.idCliente
where year(v.dataVenda) = 2020;

select * from show_venda_2020;

create index indClienteNome on cliente(nome);

alter table cliente
drop index indClienteNome;

/*5*/
create database sistema_boate;
use sistema_boate;

CREATE TABLE PESSOA (
    idPessoa int not null auto_increment primary key,
    nome varchar(30),
    cpf char(11),
    nascimento date,
    idEndereco int,
    idTelefone int
);

create index indPessoaNome on pessoa(nome);

alter table pessoa
drop index indProdutoNome;

select * from pessoa
group by nome
order by idPessoa;

